    data: |
      SELECT ( 31 ) + - - col1 AS col1 FROM tab2 (FORMAT parquet) WHERE - 95 - + col0 NOT IN ( - col2 * - col1, + 80, - 12 );
  - name: tab2

outputs:
  - name: q11201.out
    data: |
      108
      82
      98
